How to Take Blood Oxygen Measurement:
1. Wear the watch one finger's width below the wrist bone, and wear it in a comfortable position on the wrist; 
2. After entering the blood oxygen detection mode, please keep still, make sure your wrist is flat and the watch is facing up. If you are sitting, you can put your arms on the table with your watch facing up; 
3. Please keep your arm steady until you get the final result.
